class PixelPay {
  PixelPay({
      num? total,
      num? totalHits,
      List<Hits>? hits,}){
    _total = total;
    _totalHits = totalHits;
    _hits = hits;
}

  PixelPay.fromJson(dynamic json) {
    _total = json['total'];
    _totalHits = json['totalHits'];
    if (json['hits'] != null) {
      _hits = [];
      json['hits'].forEach((v) {
        _hits?.add(Hits.fromJson(v));
      });
    }
  }
  num? _total;
  num? _totalHits;
  List<Hits>? _hits;
PixelPay copyWith({  num? total,
  num? totalHits,
  List<Hits>? hits,
}) => PixelPay(  total: total ?? _total,
  totalHits: totalHits ?? _totalHits,
  hits: hits ?? _hits,
